import React from 'react'
import { SliderData } from './SliderData'

function ImageSlider() {
  return (
      <>
      {SliderData.map((slide, index) => {
          return (
              <img src={slide.image} alt="wolf image" />
          )
      })}
      </>
  )
}

export default ImageSlider
